                        <a className="slide" href=""><img src={process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail_jobfind0203'} alt="" /></a>
                        <a className="slide" href=""><img src={process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail_jobfind0204'} alt="" /></a>
                        <a className="slide" href=""><img src={process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail_jobfind0205'} alt="" /></a>
                        <a className="slide" href=""><img src={process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail_jobfind0206'} alt="" /></a>
                    </div>
            </div>
        </section>
    )
}

